import{_ as e}from"./chunks/gitlab.B-LacI_W.js";import{_ as i,c as r,o as t,U as a}from"./chunks/framework.aGaNZw_P.js";const g=JSON.parse('{"title":"GitLab","description":"Introduction au travail à plusieurs avec GIT.","frontmatter":{"description":"Introduction au travail à plusieurs avec GIT."},"headers":[],"relativePath":"tp/gitlab/index.md","filePath":"tp/gitlab/index.md","lastUpdated":1706824226000}'),o={name:"tp/gitlab/index.md"},s=a('<h1 id="gitlab" tabindex="-1">GitLab <a class="header-anchor" href="#gitlab" aria-label="Permalink to &quot;GitLab&quot;">​</a></h1><p>Introduction au travail à plusieurs avec GIT.</p><h2 id="ressources-utiles" tabindex="-1">Ressources utiles <a class="header-anchor" href="#ressources-utiles" aria-label="Permalink to &quot;Ressources utiles&quot;">​</a></h2><ul><li><a href="https://github.com/c4software/cheatsheet/blob/master/git/" target="_blank" rel="noreferrer">Aide mémoire</a></li><li><a href="https://docs.gitlab.com/ee/README.html" target="_blank" rel="noreferrer">Documentation Gitlab</a></li><li><a href="https://git-scm.com/book/fr/v2" target="_blank" rel="noreferrer">Livre Git en ligne</a></li><li><a href="https://www.gitlab.com/" target="_blank" rel="noreferrer">GitLab.com</a></li><li><a href="/cheatsheets/ssh-key/">Créer une clé SSH</a></li></ul><h2 id="situation" tabindex="-1">Situation <a class="header-anchor" href="#situation" aria-label="Permalink to &quot;Situation&quot;">​</a></h2><p>L’entreprise ou vous effectuez votre stage utilise GitLab, vous allez donc devoir utiliser en plus de GIT un outil permettant de gérer votre « workflow de travail ».</p><h3 id="questions" tabindex="-1">Questions <a class="header-anchor" href="#questions" aria-label="Permalink to &quot;Questions&quot;">​</a></h3><ul><li>Pourquoi à votre avis l’entreprise utilise GitLab ?</li><li>Pourquoi GitLab plutôt que GitHub ?</li></ul><div class="tip custom-block"><p class="custom-block-title">Comment choisir ?</p><p>Je vous laisse regarder sur le site de Gitlab et le site de Github. Et plus particulièrement :</p><ul><li><a href="https://github.com/pricing" target="_blank" rel="noreferrer">https://github.com/pricing</a></li><li><a href="https://about.gitlab.com/pricing/" target="_blank" rel="noreferrer">https://about.gitlab.com/pricing/</a></li><li><a href="https://about.gitlab.com/install/ce-or-ee/" target="_blank" rel="noreferrer">https://about.gitlab.com/install/ce-or-ee/</a></li><li><a href="https://github.com/features" target="_blank" rel="noreferrer">https://github.com/features</a></li><li><a href="https://about.gitlab.com/features/" target="_blank" rel="noreferrer">https://about.gitlab.com/features/</a></li><li><a href="https://www.ionos.fr/digitalguide/sites-internet/developpement-web/gitlab-vs-github/" target="_blank" rel="noreferrer">https://www.ionos.fr/digitalguide/sites-internet/developpement-web/gitlab-vs-github/</a></li></ul></div><p>Après avoir regardé les différents documents, nous allons réfléchir ensemble. Avant de continuer, je vous propose de faire un document listant les différences entre Github et GitLab.</p><p>En groupe (de deux) ou seul, votre document doit posséder des arguments pour choisir l’un ou l’autre des services. Vous pouvez également ajouter des arguments pour choisir un service auto-hébergé.</p><h2 id="contraintes-de-l-entreprise" tabindex="-1">Contraintes de l’entreprise <a class="header-anchor" href="#contraintes-de-l-entreprise" aria-label="Permalink to &quot;Contraintes de l’entreprise&quot;">​</a></h2><p>Afin de s&#39;assurer de la qualité du code, l&#39;entreprise souhaite que vous utilisiez GitLab pour versionner votre code. Elle vous impose également quelques règles :</p><ul><li>Vous devez utiliser GitLab pour versionner votre code.</li><li>Vous devez utiliser des branches pour travailler sur votre projet.</li><li>Les branches doivent être nommées de la façon suivante : <code>feature/ma-branche</code>. (ex: <code>feature/ajout-article-git</code>)</li><li>Vous devez faire des commits régulièrement. La fréquence est à définir en fonction de votre vision du projet.</li><li>Vous devez utiliser des messages de commit explicites. (ex: <code>Ajout d’un nouvel article sur Git</code>)</li><li>Vous devez faire des merges requests pour fusionner vos branches avec la branche <code>master</code>.</li><li>Vous devez cloner votre projet sur votre ordinateur. En utilisant obligatoirement une clé SSH.</li></ul><div class="tip custom-block"><p class="custom-block-title">✨ Ce TP est évalué ✨</p><p>Ce TP est évalué, il est donc important de le réaliser correctement. Vous pouvez vous aider des ressources ci-dessus.</p></div><h2 id="le-tp" tabindex="-1">Le TP <a class="header-anchor" href="#le-tp" aria-label="Permalink to &quot;Le TP&quot;">​</a></h2><p>Dans ce TP vous allez avoir trois étapes importantes :</p><ul><li>Versionner votre projet avec Git.</li><li>Travailler avec Gitlab directement sur le Web (via le Web IDE).</li><li>Travailler avec Gitlab depuis votre ordinateur (envoi du code avec le push).</li></ul><h2 id="creation-du-projet" tabindex="-1">Création du projet <a class="header-anchor" href="#creation-du-projet" aria-label="Permalink to &quot;Création du projet&quot;">​</a></h2><p>Avant d’utiliser GitLab nous allons dans un premier temps créer un site Internet sur votre ordinateur.</p><p>Je vous propose de versionner le blog que vous avez réalisé dans le cadre de la première AP. Je vous laisse :</p><ul><li>Créer un dossier blog sur votre ordinateur (ou de réutiliser le dossier que vous avez créé dans le cadre de la première AP)</li><li>Initialiser un projet git dans ce dossier. (<code>git init</code>)</li><li>Créer un premier commit avec le message « Initialisation du projet ».</li><li>Réaliser une modification en ajouter un nouvel article dans votre blog. (thématique <code>git</code>).</li><li>Créer un nouveau commit avec le message « Ajout d’un nouvel article sur Git ».</li></ul><h2 id="les-logs" tabindex="-1">Les logs <a class="header-anchor" href="#les-logs" aria-label="Permalink to &quot;Les logs&quot;">​</a></h2><p>Vérifier que votre projet est bien commité, avec la commande <code>git status</code>. Vous pouvez également vérifier l’historique de vos commits via <code>git log</code></p><ul><li>Votre historique contient-il bien les deux commits que vous avez réalisés ?</li><li>Quelle est la différence entre <code>git status</code> et <code>git log</code> ?</li></ul><h2 id="gitlab-1" tabindex="-1">GitLab <a class="header-anchor" href="#gitlab-1" aria-label="Permalink to &quot;GitLab&quot;">​</a></h2><h3 id="creation-du-compte" tabindex="-1">Création du compte <a class="header-anchor" href="#creation-du-compte" aria-label="Permalink to &quot;Création du compte&quot;">​</a></h3><p>Créer votre compte sur la plateforme de votre choix, nous avons trois choix possibles :</p><ul><li><a href="http://gitlab.dombtsig.local/" target="_blank" rel="noreferrer">Gitlab du lycée</a></li><li><a href="https://gitlab.com/users/sign_in" target="_blank" rel="noreferrer">GitLab</a></li><li><a href="https://github.com/signup" target="_blank" rel="noreferrer">Github</a></li></ul><p>Ce compte sera utile pour plusieurs projets, remplissez les champs avec attention.</p><div class="tip custom-block"><p class="custom-block-title">Comment choisir ?</p><p>Nous avons fait le choix de mettre en place un Gitlab dans la section BTS. Cela permet de vous donner un accès à un Gitlab sans avoir à créer un compte sur un service externe. Cependant, vous pouvez utiliser le service de votre choix.</p><p>Avoir un compte Github est également intéressant, car c’est un service très utilisé dans le monde du développement. Cela vous permettra de vous familiariser avec l’outil, et de vous créer un profil « professionnel ».</p><p>Cependant, pour l&#39;instant vos réalisations sont « débutantes », et vous n&#39;avez pas forcément envie de les partager avec le monde entier. C&#39;est pourquoi, je vous conseille plutôt d&#39;utiliser le Gitlab du lycée.</p></div><h4 id="echange-de-cle" tabindex="-1">Échange de clé <a class="header-anchor" href="#echange-de-cle" aria-label="Permalink to &quot;Échange de clé&quot;">​</a></h4><p>Pour vous reconnaître, GitLab/Github utilise un système de clé. Cette clé garantit votre identité sans utiliser un mot de passe.</p><h4 id="generation-de-votre-cle" tabindex="-1">Génération de votre clé <a class="header-anchor" href="#generation-de-votre-cle" aria-label="Permalink to &quot;Génération de votre clé&quot;">​</a></h4><p>Cette procédure n&#39;est à faire qu&#39;une seule fois « par ordinateur », la clé que nous allons générer aujourd&#39;hui vous servira pendant les deux ans.</p><p>Rendez-vous sur l&#39;aide mémoire pour suivre la procédure : <a href="/cheatsheets/ssh-key/">Voir l&#39;aide mémoire sur comment créer une clé SSH</a></p><p>🚨 La procédure de génération de clé est la même pour Github et Gitlab, vous pouvez donc utiliser la même clé pour les deux services. 🚨</p><div class="tip custom-block"><p class="custom-block-title">Important</p><ul><li>Cette clé est générée sur votre profil utilisateur, et ce quelques soit le poste au lycée. Vous pouvez donc utiliser cette clé sur plusieurs projets.</li><li>Cette opération ne doit être faite qu’une seule fois.</li></ul></div><p>👋 Parlons un peu de cette clé. Elle est composée de deux parties :</p><ul><li>Une partie publique (que vous pouvez partager avec qui vous voulez)</li><li>Une partie privée (que vous devez absolument garder pour vous)</li></ul><h4 id="envoyer-votre-cle-sur-gitlab" tabindex="-1">Envoyer votre clé sur GitLab <a class="header-anchor" href="#envoyer-votre-cle-sur-gitlab" aria-label="Permalink to &quot;Envoyer votre clé sur GitLab&quot;">​</a></h4><p><a href="https://gitlab.dombtsig.local/-/profile/keys" target="_blank" rel="noreferrer">Ajouter une clé sur votre profil</a></p><p>La clé que vous devez envoyer est dans votre dossier personnel (<code>P:</code>) dans le dossier <code>.ssh</code>. Une fois dans le dossier (masqué par défaut) vous avez deux fichiers. Le fichier que vous devez ouvrir et copier le contenu est celui dont l’extension est <code>.pub</code> (<strong>à ouvrir avec notepad++ ou bloc-note</strong>).</p><div class="tip custom-block"><p class="custom-block-title">Cette clé est importante</p><p>Vous devez vraiment maîtriser cette étape. C&#39;est une notion très importante dans le monde du développement. Si vous souhaitez en savoir plus, n&#39;hésiter pas à me demander 👋.</p></div><h3 id="creation-de-votre-premier-projet" tabindex="-1">Création de votre premier projet <a class="header-anchor" href="#creation-de-votre-premier-projet" aria-label="Permalink to &quot;Création de votre premier projet&quot;">​</a></h3><p>Maintenant que votre compte est créé (et que l’échange de clé est effectif), vous allez pouvoir créer un nouveau projet. Ce projet gitlab aura pour vocation de contenir les sources de votre site Internet (projet, que vous aller me partager). Donc, nommer le bien !</p><ul><li>Je vous laisse explorer les menus de GitLab pour créer votre projet.</li><li>Attention, vous devez choisir le type de projet Blank project ».</li><li>Vous devez choisir la visibilité du projet. (Public ou Private).</li></ul><h3 id="question" tabindex="-1">Question <a class="header-anchor" href="#question" aria-label="Permalink to &quot;Question&quot;">​</a></h3><ul><li>Comment choisir la visibilité du projet ? (Visiblity Level)</li></ul><h3 id="envoi-sur-gitlab" tabindex="-1">Envoi sur GitLab <a class="header-anchor" href="#envoi-sur-gitlab" aria-label="Permalink to &quot;Envoi sur GitLab&quot;">​</a></h3><p>Maintenant que votre projet est créé, GitLab doit vous donner les instructions pour « pusher » votre projet sur le serveur. Suivez les instructions.</p><p>Je vous invite pour cette première fois à suivre les instructions que Gitlab vous donne.</p><h4 id="exemple" tabindex="-1">Exemple : <a class="header-anchor" href="#exemple" aria-label="Permalink to &quot;Exemple :&quot;">​</a></h4><p><img src="'+e+'" alt="Création d’un projet" loading="lazy"></p><p>Une fois que c’est fait. Regarder les différentes options que GitLab vous propose.</p><ul><li>Inviter un (ou plusieurs) autre étudiant dans votre projet (c’est dans l’onglet Members dans les paramètres)</li><li>Créer une nouvelle issue</li><li>Assigner l’issue à vous-même (ou à un autre étudiant).</li><li>Regarder les options autour de l’issue (Création de branch, issue board, etc…)</li></ul><h3 id="edition-en-ligne-via-gitlab" tabindex="-1">Édition en ligne (via GitLab) <a class="header-anchor" href="#edition-en-ligne-via-gitlab" aria-label="Permalink to &quot;Édition en ligne (via GitLab)&quot;">​</a></h3><p>GitLab permet de se passer (en partie) d’un éditeur sur votre poste, tester les différentes fonctionnalités :</p><ul><li><p>Créer une issue (exemple, Ajout d&#39;une nouvelle image sur la page d’accueil)</p></li><li><p>Créer une branche relative à cette issue.</p></li><li><p>Vérifier que vous êtes bien sur la branche en question avant d’éditer le fichier index.html dans l’onglet <code>files</code></p></li><li><p>Ajouter une image dans votre projet (via GitLab)</p></li><li><p>Ajouter dans la page index.html l’image en question (<code>&lt;img src…</code>)</p></li><li><p>⚠️ Comme en local, le commentaire est très important ! Indiquer un commentaire pertinent. (Astuce si vous ajoutez à la fin de votre commentaire Close #1, l’issue sera automatiquement « fermée » une fois votre modification en place sur la master. Je vous laisse tester 😉).</p></li><li><p>Une fois les modifications faites, vous allez pouvoir créer une <code>merge request</code>. Une fois le merge request créé, assignez-le à un autre étudiant ! Demandez-lui de le merger pour vous.</p></li><li><p>⚠️ ⚠️ L’autre étudiant doit regarder le code, et si possible vous faire des commentaires, par exemple : _ Tu as oublié le <code>alt</code> à ton image. _ Tu as oublié le <code>title</code> à ton image. * Ou même pourquoi as-tu choisi cette image ?</p></li><li><p>Prenez en compte les remarques et modifiez le code</p></li><li><p>Ajouter un commentaire (dans le merge request) pour indiquer à l’autre étudiant que vous avez terminé.</p></li><li><p>L’autre étudiant approuve votre code.</p></li><li><p>Vous pouvez merger votre code.</p></li></ul><h3 id="question-a-faire-en-groupe" tabindex="-1">Question (à faire en groupe) <a class="header-anchor" href="#question-a-faire-en-groupe" aria-label="Permalink to &quot;Question (à faire en groupe)&quot;">​</a></h3><ul><li>Pourquoi est-ce que l’on utilise des branches ?</li><li>Pourquoi demander à un autre étudiant d&#39;approuver votre code ?</li></ul><h3 id="observation" tabindex="-1">Observation <a class="header-anchor" href="#observation" aria-label="Permalink to &quot;Observation&quot;">​</a></h3><p>Je vous invite à regarder les différentes options de GitLab. Vous pouvez par exemple :</p><ul><li>Créer un « issue board » (un tableau Kanban)</li><li>Créer un « wiki »</li><li>Créer un « snippet »</li></ul><p>Pourquoi est-ce intéressant ?</p><h3 id="mettre-a-jour-votre-projet" tabindex="-1">Mettre à jour votre projet <a class="header-anchor" href="#mettre-a-jour-votre-projet" aria-label="Permalink to &quot;Mettre à jour votre projet&quot;">​</a></h3><p>Vous avez édité votre projet en ligne, c&#39;est bien… mais maintenant comment récupérer les modifications sur votre poste ? Pour récupérer les modifications, vous allez devoir faire un <code>pull</code> sur votre projet.</p><div class="language-sh vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> pull</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><div class="tip custom-block"><p class="custom-block-title">Attention</p><p>Vous devez être dans le dossier du projet pour faire un <code>pull</code>. Sinon Git vous dira que vous n’êtes pas dans un dépôt git.</p></div><p>Je vous laisse vérifier si vous avez bien récupéré les modifications (en regardant le fichier index.html par exemple, ou via un <code>git status</code>).</p><h2 id="edition-en-local" tabindex="-1">Édition en local <a class="header-anchor" href="#edition-en-local" aria-label="Permalink to &quot;Édition en local&quot;">​</a></h2><p>Maintenant que vous avez compris le fonctionnement de GitLab, vous allez pouvoir travailler en local. Pour faire cela, nous allons reprendre le processus depuis le début, et faire comme si vous étiez sur un nouvel ordinateur.</p><p>Quand nous changerons de poste, la première chose à faire sera de :</p><ul><li>Cloner le projet</li></ul><div class="warning custom-block"><p class="custom-block-title">Stop !</p><p><strong>L&#39;étape de clone</strong>, n&#39;est pas à faire si vous êtes sur le même poste que précédemment. Elle est à faire si vous êtes sur un nouveau poste, ou si vous avez supprimé le dossier du projet.</p></div><h3 id="cloner-le-projet" tabindex="-1">Cloner le projet <a class="header-anchor" href="#cloner-le-projet" aria-label="Permalink to &quot;Cloner le projet&quot;">​</a></h3><p>Vous souhaitez maintenant modifier le code sur votre machine. Pour cela, vous <strong>devez</strong> cloner le projet.</p><div class="danger custom-block"><p class="custom-block-title">Vous ne pouvez pas deviner les commandes !</p><p>Pour vous aider, n&#39;hésitez pas à regarder <a href="/cheatsheets/git/">l&#39;aide mémoire git</a></p></div><h3 id="cloner-le-projet-sur-votre-machine" tabindex="-1">Cloner le projet sur votre machine <a class="header-anchor" href="#cloner-le-projet-sur-votre-machine" aria-label="Permalink to &quot;Cloner le projet sur votre machine&quot;">​</a></h3><div class="language-sh vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="creer-une-issue" tabindex="-1">Créer une issue <a class="header-anchor" href="#creer-une-issue" aria-label="Permalink to &quot;Créer une issue&quot;">​</a></h2><p>Dans votre projet, créez une seconde issue. (Exemple : Ajouter une page à propos)</p><ul><li>Assignez-vous cette issue.</li><li>Créer une nouvelle branche pour cette issue.</li><li>Traiter la modification en local.</li><li>Envoyer vos modifications sur le serveur GitLab.</li><li>Créez une merge request et assignez-la à un autre étudiant pour qu’il la valide.</li><li>Une fois la merge request validée, merger la branche.</li></ul><h3 id="mettre-a-jour-le-code-local" tabindex="-1">Mettre à jour le code local. <a class="header-anchor" href="#mettre-a-jour-le-code-local" aria-label="Permalink to &quot;Mettre à jour le code local.&quot;">​</a></h3><p>Avant de commencer à travailler, il est important de mettre à jour votre code local. Pour cela, il faut faire un <code>pull</code> sur la branche <code>master</code>.</p><div class="language-sh vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="creer-une-nouvelle-branche" tabindex="-1">Créer une nouvelle branche <a class="header-anchor" href="#creer-une-nouvelle-branche" aria-label="Permalink to &quot;Créer une nouvelle branche&quot;">​</a></h3><div class="language-sh vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="changer-de-branche" tabindex="-1">Changer de branche <a class="header-anchor" href="#changer-de-branche" aria-label="Permalink to &quot;Changer de branche&quot;">​</a></h3><div class="language-sh vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="envoyer-vos-modifications-sur-le-serveur-gitlab" tabindex="-1">Envoyer vos modifications sur le serveur GitLab <a class="header-anchor" href="#envoyer-vos-modifications-sur-le-serveur-gitlab" aria-label="Permalink to &quot;Envoyer vos modifications sur le serveur GitLab&quot;">​</a></h3><div class="language-sh vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="creer-une-merge-request" tabindex="-1">Créer une merge request <a class="header-anchor" href="#creer-une-merge-request" aria-label="Permalink to &quot;Créer une merge request&quot;">​</a></h3><p>Maintenant que vous avez terminé votre travail, vous allez devoir créer une merge request. Pour cela, il faut aller sur le serveur GitLab, et aller dans l’onglet <code>merge request</code>.</p><h3 id="question-1" tabindex="-1">Question <a class="header-anchor" href="#question-1" aria-label="Permalink to &quot;Question&quot;">​</a></h3><ul><li>Pourquoi travailler de cette façon ?</li></ul><h2 id="bonne-nouvelle" tabindex="-1">Bonne nouvelle ! <a class="header-anchor" href="#bonne-nouvelle" aria-label="Permalink to &quot;Bonne nouvelle !&quot;">​</a></h2><p>Vous venez (normalement) d’avoir au moins un « merge request » d’assigner. Vous allez devoir traiter la demande, à votre avis, comment se déroule la suite ?</p><h2 id="la-revue-de-code" tabindex="-1">La revue de code <a class="header-anchor" href="#la-revue-de-code" aria-label="Permalink to &quot;La revue de code&quot;">​</a></h2><ul><li>Regarder l’issue.</li><li>Regarder le code de votre « collègue ».</li><li>Apporter des commentaires <ul><li>Dans l’issue, générale.</li><li>Directement dans la partie code de l’issue.</li></ul></li><li>Laisser votre collègue effectuer « les corrections » par rapport à votre commentaire (ou débattre de pourquoi, etc.). DISCUTER ! (du code)</li><li>Si tout vous semble correcte « Merger » les modifications.</li></ul><h3 id="questions-1" tabindex="-1">Questions <a class="header-anchor" href="#questions-1" aria-label="Permalink to &quot;Questions&quot;">​</a></h3><ul><li>Quel est l’intérêt ?</li><li>Est-ce contraignant ?</li><li>Vous y voyez un intérêt ?</li><li>À votre avis, est-il possible d’améliorer la revue de code ?</li><li>En situation réelle, est-ce votre rôle de « merger le code » ?</li></ul><h2 id="ajout-d-une-page-a-propos" tabindex="-1">Ajout d&#39;une page à propos <a class="header-anchor" href="#ajout-d-une-page-a-propos" aria-label="Permalink to &quot;Ajout d&#39;une page à propos&quot;">​</a></h2><p>En utilisant le processus vu précédemment, ajouter une page « à propos » dans votre blog. Vous n&#39;oublierez pas :</p><ul><li>De créer une issue.</li><li>De créer une branche.</li><li>De créer une merge request.</li><li>De réaliser une revue de code (avec des commentaires).</li><li>De merger le code.</li></ul><h2 id="questions-2" tabindex="-1">Questions <a class="header-anchor" href="#questions-2" aria-label="Permalink to &quot;Questions&quot;">​</a></h2><ul><li>À quoi sert la commande <code>git log</code> ?</li><li>À quoi sert la commande <code>git status</code> ?</li><li>À quoi sert la commande <code>git commit</code> ?</li><li>Quelle commande permet de récupérer les modifications d’un dépôt distant ?</li><li>Quelle commande permet d&#39;envoyer les modifications sur le dépôt distant ?</li><li>Pourquoi est-il important de faire un <code>pull</code> avant de commencer à travailler ?</li><li>Décrire le processus d&#39;utilisation de Git et GitLab ? (Vous pouvez utiliser un schéma si vous le souhaitez (ex : <a href="https://www.draw.io/" target="_blank" rel="noreferrer">https://www.draw.io/</a>)))</li></ul><h2 id="document-a-rendre" tabindex="-1">Document à rendre <a class="header-anchor" href="#document-a-rendre" aria-label="Permalink to &quot;Document à rendre&quot;">​</a></h2><ul><li>Screenshot de la clé SSH sur votre compte GitLab.</li><li>Le document listant les différences entre Github et GitLab.</li><li>Vos réponses aux questions et commandes présentes dans ce TP (format PDF).</li><li>Lien vers votre projet GitLab (n&#39;oubliez pas de m&#39;inviter en tant que membre).</li></ul><h2 id="rendu" tabindex="-1">Rendu <a class="header-anchor" href="#rendu" aria-label="Permalink to &quot;Rendu&quot;">​</a></h2><p>La restitution est à faire en utilisant le lien suivant : <a href="https://forms.gle/f1hTk9X1EUAkgECp6" target="_blank" rel="noreferrer">https://forms.gle/f1hTk9X1EUAkgECp6</a></p>',111),l=[s];function n(u,d,c,p,h,v){return t(),r("div",null,l)}const f=i(o,[["render",n]]);export{g as __pageData,f as default};
